import React, { Component } from 'react'
import "./App.css"

class App extends Component {
  render() {
    return (
      <div className='App'>
        <h1>My list</h1>
        <button>Clear list</button>
        <ul></ul>
        <form>
          <input type="text"/> <br></br>
          <input type="submit" value="Add item"/>
        </form>
      </div>
    )
  }
}

export default App;
